package br.com.restaurante.model;import java.util.List;@SuppressWarnings("serial")public class PerfilModel extends BaseModel implements CrudModel<PerfilModel> {	private String descricao;	private String codigo;		private List<PerfilModel> historico;		private List<PerfilProcedimentoModel> procedimentos;	public PerfilModel() {		super();	}		public PerfilModel(Long id) {		super();		this.id = id;	}	public String getDescricao() {		return descricao;	}	public void setDescricao(String descricao) {		this.descricao = descricao;	}	public String getCodigo() {		return codigo;	}	public void setCodigo(String codigo) {		this.codigo = codigo;	}	public List<PerfilModel> getHistorico() {		return historico;	}	public void setHistorico(List<PerfilModel> historico) {		this.historico = historico;	}	public List<PerfilProcedimentoModel> getProcedimentos() {		return procedimentos;	}	public void setProcedimentos(List<PerfilProcedimentoModel> procedimentos) {		this.procedimentos = procedimentos;	}}